import React from 'react'
import { Line } from 'react-chartjs-2';
import Chart from '../Components/Chart';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js';

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
);

const ChartComponent = ({x, y}) => {
    return (
        <Line data={{
                labels: x,
                datasets: [
                    {
                        label: 'Training Accuracy',
                        data: y,
                        borderColor: '#3C51F9',
                        tension: 0,
                        backgroundColor: [
                            'rgb(255, 255, 255)'
                        ],
                    },
                ],
            }} 
            options={{
                plugins: {
                  title: {
                    display: true,
                    text: 'Chart with Tick Configuration'
                  }
                },
                scales: {
                    yAxes: [{
                        display: true,
                        ticks: {
                            beginAtZero: true,
                        }
                    }],
                    x: {
                        display: true,
                        title: {
                          display: true,
                          text: 'Training Accuracy',
                          color: 'white',
                          padding: {top: 20, left: 0, right: 20, bottom: 0}
                        }
                      },
                      y: {
                        display: true,
                        title: {
                          display: true,
                          text: 'Epochs',
                          color: 'white',
                          padding: {top: 30, left: 0, right: 0, bottom: 0}
                        }
                      }
                },
                maintainAspectRatio: false,
                responsive: false,
                animation: false
            }}
            height={350} 
            width={350}
        />
    )
}

export default ChartComponent
